Toyota is similar to:
 Toyota Motor Co., Ltd. in that both companies are global manufacturers of vehicles. Toyota is headquartered in Toyo, Japan and Toyota Motor Corporation is headquartered in Toyoda.

Toyota has approximately 7,000 employees and Toyota Motor Corp. has approximately 3,500 employees. Toyota is the world's largest automaker with approximately 4.6 million vehicles sold in 2015.

Toyota is the largest automaker in the U.S. with a market share of about 26 percent. Toyota has a market share of about 28 percent in the U.S. and about 9 percent in Canada.

Toyota and Toyota Motor Corp. are subject to the U.S. federal government's Foreign Corrupt Practices Act (FCPA). The FCPA prohibits foreign companies from engaging in any of the following:

bribing government officials or officials of foreign governments;

making a false statement in a public proceeding;

making a false statement in connection with a trade or business;

fraudulently influencing a competitor in the business of another company;

fraudulently influencing a foreign government;

fraudulently influencing a foreign government's foreign policy;

fraudulently influencing a foreign government's official policies;

fraudulently influencing a foreign government's official associations;

fraudulently influencing a foreign government's official activities;

fraudulently influencing a foreign government's official financial interests;
